// Name: alejo.2014 utilities
// ID: almejasID
// Description: Just some utilities that in some cases work and in others not
// By: Alejo.2014
// Version V.1.0.0

(async function(Scratch) {
    const variables = {};
    const blocks = [];
    const menus = {};


    if (!Scratch.extensions.unsandboxed) {
        alert("This extension needs to be unsandboxed to run!")
        return
    }

    function doSound(ab, cd, runtime) {
        const audioEngine = runtime.audioEngine;

        const fetchAsArrayBufferWithTimeout = (url) =>
            new Promise((resolve, reject) => {
                const xhr = new XMLHttpRequest();
                let timeout = setTimeout(() => {
                    xhr.abort();
                    reject(new Error("Timed out"));
                }, 5000);
                xhr.onload = () => {
                    clearTimeout(timeout);
                    if (xhr.status === 200) {
                        resolve(xhr.response);
                    } else {
                        reject(new Error(`HTTP error ${xhr.status} while fetching ${url}`));
                    }
                };
                xhr.onerror = () => {
                    clearTimeout(timeout);
                    reject(new Error(`Failed to request ${url}`));
                };
                xhr.responseType = "arraybuffer";
                xhr.open("GET", url);
                xhr.send();
            });

        const soundPlayerCache = new Map();

        const decodeSoundPlayer = async (url) => {
            const cached = soundPlayerCache.get(url);
            if (cached) {
                if (cached.sound) {
                    return cached.sound;
                }
                throw cached.error;
            }

            try {
                const arrayBuffer = await fetchAsArrayBufferWithTimeout(url);
                const soundPlayer = await audioEngine.decodeSoundPlayer({
                    data: {
                        buffer: arrayBuffer,
                    },
                });
                soundPlayerCache.set(url, {
                    sound: soundPlayer,
                    error: null,
                });
                return soundPlayer;
            } catch (e) {
                soundPlayerCache.set(url, {
                    sound: null,
                    error: e,
                });
                throw e;
            }
        };

        const playWithAudioEngine = async (url, target) => {
            const soundBank = target.sprite.soundBank;

            let soundPlayer;
            try {
                const originalSoundPlayer = await decodeSoundPlayer(url);
                soundPlayer = originalSoundPlayer.take();
            } catch (e) {
                console.warn(
                    "Could not fetch audio; falling back to primitive approach",
                    e
                );
                return false;
            }

            soundBank.addSoundPlayer(soundPlayer);
            await soundBank.playSound(target, soundPlayer.id);

            delete soundBank.soundPlayers[soundPlayer.id];
            soundBank.playerTargets.delete(soundPlayer.id);
            soundBank.soundEffects.delete(soundPlayer.id);

            return true;
        };

        const playWithAudioElement = (url, target) =>
            new Promise((resolve, reject) => {
                const mediaElement = new Audio(url);

                mediaElement.volume = target.volume / 100;

                mediaElement.onended = () => {
                    resolve();
                };
                mediaElement
                    .play()
                    .then(() => {
                        // Wait for onended
                    })
                    .catch((err) => {
                        reject(err);
                    });
            });

        const playSound = async (url, target) => {
            try {
                if (!(await Scratch.canFetch(url))) {
                    throw new Error(`Permission to fetch ${url} denied`);
                }

                const success = await playWithAudioEngine(url, target);
                if (!success) {
                    return await playWithAudioElement(url, target);
                }
            } catch (e) {
                console.warn(`All attempts to play ${url} failed`, e);
            }
        };

        playSound(ab, cd)
    }
    class Extension {
        getInfo() {
            return {
                "blockIconURI": "data:image/png;base64,",
                "id": "almejasID",
                "name": "Alejo.2014 utilities",
                "color1": "#d6d6d6",
                "color2": "#8c8c8c",
                "color3": "#8c8c8c",
                "blocks": blocks,
                "menus": menus
            }
        }
    }
    blocks.push({
        opcode: "RANDOMD",
        blockType: Scratch.BlockType.BOOLEAN,
        text: "random decision",
        arguments: {},
        disableMonitor: true
    });
    Extension.prototype["RANDOMD"] = async (args, util) => {
        if (Boolean((Math.floor(Math.random() * (1 - 0 + 1) + 0) == 0))) {
            return true

        } else {
            return false

        };
    };

    blocks.push({
        opcode: "IFTE",
        blockType: Scratch.BlockType.REPORTER,
        text: "if [BOO] then [TH] else [EL]",
        arguments: {
            "BOO": {
                type: Scratch.ArgumentType.BOOLEAN,
            },
            "TH": {
                type: Scratch.ArgumentType.STRING,
            },
            "EL": {
                type: Scratch.ArgumentType.STRING,
            },
        },
        disableMonitor: true
    });
    Extension.prototype["IFTE"] = async (args, util) => {
        return (args["BOO"] ? args["TH"] : args["EL"])
    };

    blocks.push({
        opcode: "ALERT",
        blockType: Scratch.BlockType.COMMAND,
        text: "Alert [ALERTID]",
        arguments: {
            "ALERTID": {
                type: Scratch.ArgumentType.STRING,
            },
        },
        disableMonitor: true
    });
    Extension.prototype["ALERT"] = async (args, util) => {
        alert(args["ALERTID"])
    };

    blocks.push({
        opcode: "PROMPT",
        blockType: Scratch.BlockType.REPORTER,
        text: "prompt [PROMPTID]",
        arguments: {
            "PROMPTID": {
                type: Scratch.ArgumentType.STRING,
            },
        },
        disableMonitor: true
    });
    Extension.prototype["PROMPT"] = async (args, util) => {
        return prompt(args["PROMPTID"])
    };

    blocks.push({
        opcode: "CONFIRM",
        blockType: Scratch.BlockType.BOOLEAN,
        text: "confirm [CONFIRMID]",
        arguments: {
            "CONFIRMID": {
                type: Scratch.ArgumentType.STRING,
            },
        },
        disableMonitor: true
    });
    Extension.prototype["CONFIRM"] = async (args, util) => {
        return confirm(args["CONFIRMID"])
    };

    blocks.push({
        opcode: "NOTE",
        blockType: Scratch.BlockType.COMMAND,
        text: "note [NOTE]",
        arguments: {
            "NOTE": {
                type: Scratch.ArgumentType.STRING,
            },
        },
        disableMonitor: true
    });
    Extension.prototype["NOTE"] = async (args, util) => {};

    blocks.push({
        opcode: "WAITB",
        blockType: Scratch.BlockType.COMMAND,
        text: "wait [TIME] [TYPE]",
        arguments: {
            "TIME": {
                type: Scratch.ArgumentType.NUMBER,
                defaultValue: 1,
            },
            "TYPE": {
                type: Scratch.ArgumentType.STRING,
                menu: 'TYPEMENU'
            },
        },
        disableMonitor: true
    });
    Extension.prototype["WAITB"] = async (args, util) => {
        if (Boolean((args["TYPE"] == 'hours'))) {
            await new Promise(resolve => setTimeout(resolve, (args["TIME"] * 3600000 / 1)))
        };
        if (Boolean((args["TYPE"] == 'minutes'))) {
            await new Promise(resolve => setTimeout(resolve, (args["TIME"] * 60000 / 1)))
        };
        if (Boolean((args["TYPE"] == 'seconds'))) {
            await new Promise(resolve => setTimeout(resolve, (args["TIME"] * 1000 / 1)))
        };
        if (Boolean((args["TYPE"] == 'miliseconds'))) {
            await new Promise(resolve => setTimeout(resolve, args["TIME"]))
        };
    };

    menus["TYPEMENU"] = {
        acceptReporters: false,
        items: [...[...[...[...[], 'miliseconds'], 'seconds'], 'minutes'], 'hours']
    }

    Scratch.extensions.register(new Extension());
})(Scratch);